script: |
  super -f text -I q10902.spq | sort > q10902.out

inputs:
  - name: q10902.spq
    data: |
      SELECT ALL 71 + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN 55 * + + col0 * + col2 - 33 + + 59 * - + CAST ( NULL AS INTEGER ) / + col2 AND ( + col1 + + col2 * + col0 - + col2 );
  - name: tab1

outputs:
  - name: q10902.out
    data: |
